    private void jsonParse() {
        final String username = UserName.getText().toString();
        final String password = PassWord.getText().toString();

        String url = "http://192.168.1.104/android_project/login2.php";
        JsonObjectRequest request = new JsonObjectRequest(Request.Method.POST, url, null,
                new Response.Listener<JSONObject>() {
                    @Override
                    public void onResponse(JSONObject response) {

                        try {
                            //
                            JSONArray jsonArray = response.getJSONArray("data");
                            for (int i = 0; i < jsonArray.length(); i++) {
                                JSONObject employee = jsonArray.getJSONObject(i);
                                name = employee.getString("Name");
                                email = employee.getString("Email");
                                f_code = employee.getString("F_code");
                                room = employee.getString("Room");


                                tv_name.setText(name);
                                tv_email.append(String.valueOf(email));
                                tv_fcode.setText(f_code);
                                tv_room.setText(room);




                            }
                        } catch (JSONException e) {
                            e.printStackTrace();
                            //tv_room.setText(password);
                        }
                    }
                }, new Response.ErrorListener() {
            @Override
            public void onErrorResponse(VolleyError error) {
                error.printStackTrace();
            }
        }) {
            @Override
            protected Map<String, String> getParams() throws AuthFailureError {
                Map<String, String> params = new HashMap<>();
                params.put("username", username);
                params.put("password", password);

                return params;
            }
        };
        mQueue.add(request);
    }

